import React from 'react';

class Main extends React.Component {
    render() {
      return (
          <div class="header" id="main">
              <div class="container">
                          <h1>When should I sleep</h1>
                          <p>Click me when you go to bed</p>
                      </div>
                  </div>                  
      );
    }
}

export default Main;
